import React from 'react';
import ServiceC from "./ServiceCard"

const Service=()=> {
  return (
    
      <>
     <div className="container-fluid mb-auto">
          <div className="row">
              <div className="col-10 mx-auto">
                  <div className="row">                 <ServiceC/>
                 <ServiceC/>
                 <ServiceC/>
                 </div>

          </div>
      </div>
       </div>
     
    </>
  );
}

export default Service;
